import React from 'react';
import { TextField, Button, List, ListItem, ListItemText, Container, Paper, Typography } from '@mui/material';

function Dashboard({ bugs, bugName, setBugName, bugDescription, setBugDescription, handleAddBug, handleResolveBug }) {
    return (
        <Container maxWidth="md">
            <Paper sx={{ padding: 2 }}>
                <Typography variant="h4" gutterBottom>Dashboard</Typography>
                <form noValidate autoComplete="off" style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                    <TextField label="Bug Name" required fullWidth value={bugName} onChange={(e) => setBugName(e.target.value)} sx={{ marginBottom: 2 }} />
                    <TextField label="Bug Description" required fullWidth value={bugDescription} onChange={(e) => setBugDescription(e.target.value)} sx={{ marginBottom: 2 }} />
                    <Button variant="contained" color="primary" onClick={handleAddBug} sx={{ marginTop: 2 }}>Add Bug</Button>
                </form>
                <List>
                    {bugs.map(bug => (
                        <ListItem key={bug.id}>
                            <ListItemText primary={bug.name} secondary={bug.description} />
                            <Button variant="contained" color="secondary" onClick={() => handleResolveBug(bug.id)}>Resolve</Button>
                        </ListItem>
                    ))}
                </List>
            </Paper>
        </Container>
    );
}

export default Dashboard;
